import Head from "next/head";

const FolderLink = (props) => (
  <Link href={`/cudzoziemcy?id=${props.id}`} as={`/${props.id}`}>
    <a>Załatw sprawę</a>
  </Link>
);

const Navbar = () => {
  return (
    <div className="navbar-container">
      <div className="navbar-brand">
        <Link href="/">
          <a>Sprawa Dla Imigranta.pl</a>
        </Link>
      </div>
      <div className="navbar-nav">
        <Link href="/">
          <a>Strona główna</a>
        </Link>
        <FolderLink id="cudzoziemcy" />
        <Link href="/#">
          <a>Wnioski</a>
        </Link>
        <Link href="/#">
          <a>Forum</a>
        </Link>
      </div>
    </div>
  );
};

const Footer = () => {
  return (
    <div className="footer-container">
      <div className="footer-nav">
        <Link href="/">
          <a>Strona główna</a>
        </Link>
        <Link href="/katalog-spraw">
          <a>Załatw sprawę</a>
        </Link>
        <Link href="/wnioski">
          <a>Wnioski</a>
        </Link>
        <Link href="/forum">
          <a>Forum</a>
        </Link>
      </div>
      <div className="footer-copyright">
        <p>SprawaDlaImigranta.pl Wszelkie prawa zastrzeżone.</p>
      </div>
    </div>
  );
};

const BaseLayout = ({ children, title = "Sprawa Dla Imigranta" }) => {
  return (
    <div>
      <Head>
        <meta name="viewport" content="width=device-width, initial-scale=1" />
        <meta charSet="utf-8" />
        <link rel="stylesheet" href="../static/styles.css" />
        <link
          href="https://fonts.googleapis.com/css2?family=Lora:wght@400;500;700&display=swap"
          rel="stylesheet"
        />
        <title>{title}</title>
      </Head>
      <Navbar />
      <React.Fragment>{children}</React.Fragment>
      <Footer />
    </div>
  );
};

export default BaseLayout;
